import React, {Component} from "react";

class Age extends Component{
    render() {
        return (
            <div>
                <select>
                    <option value="1">一岁</option>
                    <option value="2">二岁</option>
                    <option value="3">三岁</option>
                    <option value="4">四岁</option>
                </select>
            </div>
        )
    }
}
export default Age
